function App() {
  return (
    <div>
      <AuthContextProvider>
        <Navbar />
        <Routes>
          {/* Define o Signin como a rota inicial */}
          <Route path='/' element={<Signin />} />
          
          {/* Opcional: Mantenha o Home em outra rota se precisar */}
          <Route path='/home' element={<Home />} />

          <Route
            path='/account'
            element={
              <Protected>
                <Account />
              </Protected>
            }
          />
        </Routes>
      </AuthContextProvider>
    </div>
  );
}

export default App;
